    }
  }render() {
    return (
      <div class = "grid-container-emocao center">
          <div class = "grid-container-emocao-item item-1">
              <img src = {dana} alt = "dana-triste"></img>
          </div>
          <div class = "grid-container-emocao-item item-2">
              <h1>Você está triste?</h1>
          </div>
